import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';

const StockGraph = ({ symbol }) => {
    const [graphUrl, setGraphUrl] = useState(null);

    useEffect(() => {
      // Fetch the graph URL using the symbol from the API
      fetch(`http://127.0.0.1:5000/api/twelve/graph/${symbol}`)
        .then(response => response.blob()) // Get the response as a Blob
        .then(data => {
          // Create an object URL from the Blob
          const imageUrl = URL.createObjectURL(data);
          setGraphUrl(imageUrl);
        })
        .catch(error => console.log(error));
    }, [symbol]);

    if (!graphUrl) {
      return <div>Loading graph...</div>;
    }

    return (
      <div>
        <h3>Stock Graph</h3>
        <img src={graphUrl} alt="Stock Graph" />
      </div>
    );
  };


const StockPage = () => {
  const { symbol } = useParams();
  const [stockData, setStockData] = useState(null);

  useEffect(() => {
    // Fetch stock details using the symbol from the API
    fetch(`http://127.0.0.1:5000/api/mboum/${symbol}`)
      .then(response => response.json())
      .then(data => {
        data = data.optionChain.result[0];
        setStockData(data);
      })
      .catch(error => console.log(error));
  }, [symbol]);

  if (!stockData) {
    return <div>Loading...</div>;
  }

  return (
    <div>
      <h2>{stockData.quote.longName}</h2>
      <p>Symbol: {stockData.underlyingSymbol}</p>
      <p>Price: {stockData.quote.postMarketPrice}</p>
    <p>Change: {stockData.quote.postMarketChange}</p>
    <p>Change in percent: {stockData.quote.postMarketChangePercent}</p>
    <p>Previous close: {stockData.quote.regularMarketPreviousClose}</p>
    <p>Open: {stockData.quote.regularMarketOpen}</p>
    <p>Day low: {stockData.quote.regularMarketDayLow}</p>
    <p>Day high: {stockData.quote.regularMarketDayHigh}</p>
    <p>Volume: {stockData.quote.regularMarketVolume}</p>
    <p>Average volume: {stockData.quote.averageDailyVolume3Month}</p>
    <p>Market cap: {stockData.quote.marketCap}</p>
    <p>Beta: {stockData.quote.beta}</p>
    <p>PE ratio: {stockData.quote.trailingPE}</p>
    <p>EPS: {stockData.quote.epsTrailingTwelveMonths}</p>
    <p>Dividend yield: {stockData.summaryDetail.dividendYield}</p>
    <p>Dividend rate: {stockData.summaryDetail.dividendRate}</p>
    <p>Ex-dividend date: {stockData.summaryDetail.exDividendDate}</p>
    <p>1y target estimate: {stockData.financialData.targetMeanPrice.fmt}</p>
    <p>52 week low: {stockData.summaryDetail.fiftyTwoWeekLow}</p>
    <p>52 week high: {stockData.summaryDetail.fiftyTwoWeekHigh}</p>
    <p>50 day moving average: {stockData.summaryDetail.fiftyDayAverage}</p>
    <p>200 day moving average: {stockData.summaryDetail.twoHundredDayAverage}</p>
    <p>Shares outstanding: {stockData.defaultKeyStatistics.sharesOutstanding.fmt}</p>
    <p>Shares short: {stockData.defaultKeyStatistics.sharesShort.fmt}</p>
    <p>Shares short previous month: {stockData.defaultKeyStatistics.sharesShortPriorMonth.fmt}</p>
    <p>Short ratio: {stockData.defaultKeyStatistics.shortRatio}</p>
    <p>Short percent outstanding: {stockData.defaultKeyStatistics.shortPercentOfFloat.fmt}</p>
    <p>Short percent held: {stockData.defaultKeyStatistics.shortPercentHeld.fmt}</p>
    <p>Forward PE: {stockData.summaryDetail.forwardPE}</p>
    <p>Price to book: {stockData.defaultKeyStatistics.priceToBook.fmt}</p>
    <p>Book value: {stockData.defaultKeyStatistics.bookValue.fmt}</p>
    <p>Price to sales: {stockData.defaultKeyStatistics.priceToSalesTrailing12Months.fmt}</p>
    <p>Enterprise value: {stockData.defaultKeyStatistics.enterpriseValue.fmt}</p>
    <p>Enterprise to revenue: {stockData.defaultKeyStatistics.enterpriseToRevenue.fmt}</p>
    <p>Enterprise to EBITDA: {stockData.defaultKeyStatistics.enterpriseToEbitda.fmt}</p>
    <p>Net income to common: {stockData.financialData.netIncomeToCommon.fmt}</p>
    <p>Trailing EPS: {stockData.financialData.trailingEps.fmt}</p>
    <p>Forward EPS: {stockData.financialData.forwardEps.fmt}</p>
    <p>PEG ratio: {stockData.defaultKeyStatistics.pegRatio.fmt}</p>
    <p>Price to free cash flow: {stockData.defaultKeyStatistics.priceToFreeCashFlowsTrailing12Months.fmt}</p>
    <p>Quick ratio: {stockData.financialData.quickRatio.fmt}</p>
    <p>Current ratio: {stockData.financialData.currentRatio.fmt}</p>
    <p>Debt to equity: {stockData.financialData.debtToEquity.fmt}</p>
    <p>Revenue per share: {stockData.financialData.revenuePerShare.fmt}</p>
    <p>Return on assets: {stockData.financialData.returnOnAssets.fmt}</p>
    <p>Return on equity: {stockData.financialData.returnOnEquity.fmt}</p>
    <p>Gross profits: {stockData.financialData.grossProfits.fmt}</p>
    <p>Free cash flow: {stockData.financialData.freeCashflow.fmt}</p>
    <p>Operating cash flow: {stockData.financialData.operatingCashflow.fmt}</p>
      <StockGraph symbol={symbol} />
    </div>
  );
};

export default StockPage;
